    "2013-03-15T10:58:31.584814",nt"name": "casa-grande-ruins-national-monument-vegetation-mapping-project-quickbird-satellite-imagery",nt"isopen":
    false,nt"url": null,nt"notes": "This imagery was acquired on December 3,
    2007 by DigitalGlobe, Inc.'s Quickbird satellite. Its 4 multispectral bands (blue,
    green, red, near infrared), together with the concurrently-collected panchromatic
    data, were orthorectified with ERDAS (Leica) software, using a USGS National Elevation
    Dataset digital elevation model, ground control points from ca. 2006 digital orthophoto
    quarter quadrangles (DOQQs) and the Quickbird rational polynomial coefficient model.
    Following orthorectification, the multispectral imagery, collected at 2.4-m pixel
    resolution, was sharpened with the 0.6-m panchromatic data, producing a 4-band image
    with 0.6-m resolution.",nt"license_title": null,nt"extras": [{ntt"key":
